import React from 'react';
import { useSeriesMatchList } from '../SeriesMatchListContext';

export default function SeriesMatchesTab({ seriesId }) {
  const { seriesMatches, loadingMatches } = useSeriesMatchList();

  const stageId = parseInt(seriesId);
  const matches = seriesMatches.filter(
    (m) => m.stage_id === stageId || m.stage_id === stageId + 1
  );

  if (loadingMatches) return <div>Loading matches...</div>;
  if (!matches.length) return <div>No matches found.</div>;

  return (
    <ul>
      {matches.map((match) => (
        <li key={match.id}>{match.name}</li>
      ))}
    </ul>
  );
}
